import { useDispatch, useSelector } from 'react-redux';
import { jobList } from '../../redux/action/jobAction';

const ListJob = () => {
    const dispatch = useDispatch()
    const {getListJob,getListJobLoading,getListJobError} = useSelector((state) => state.JobReducer)
    console.log(getListJob)
    useEffect(() => {
        // paggil
       console.log('komponen didmount')
        dispatch(jobList())
    }, [dispatch])

    return (
        <div className='container'>
            <h1>List Job</h1>
            {getListJob ?(
                getListJob.map((job)=>{
                    return(
                        <p>{job.title}</p>
                    )
                })
            ) : 'loading'}
        </div>
    );
}

export default ListJob;
